function initialize() {
				var mapOptions = {
					zoom : 17,
					center : new google.maps.LatLng(-3.786526, -38.553051),
					mapTypeId : google.maps.MapTypeId.HYBRID
				}
				var map = new google.maps.Map(document.getElementById("map"), mapOptions);

				marker = new google.maps.Marker({
					map : map,
					draggable : false,
					animation : google.maps.Animation.DROP,
					position : new google.maps.LatLng(-3.786526, -38.553051)
				});
				google.maps.event.addListener(marker, 'click', toggleBounce);
			}

			function toggleBounce() {
				if (marker.getAnimation() != null) {
					marker.setAnimation(null);
				} else {
					marker.setAnimation(google.maps.Animation.BOUNCE);
				}
			}

			function loadScript() {
				var script = document.createElement("script");
				script.type = "text/javascript";
				script.src = "https://maps.googleapis.com/maps/api/js?key=AIzaSyC1LQFmdvVjwGdNUCfOJoRRDv_Eds0x3f0&sensor=true&callback=initialize";
				document.body.appendChild(script);
			}


			window.onload = loadScript;

